// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

contract CPABEUserRegistry {
    struct User {
        bytes32 faceHash; // Hashed face data
        string ipfsHash;  // IPFS hash of encrypted data
    }

    mapping(address => User) private users;
    mapping(address => bool) public isRegistered;

    event UserRegistered(address indexed user, string ipfsHash);
    event UserDataRetrieved(address indexed user, string ipfsHash);

    function registerUser(bytes32 _faceHash, string memory _ipfsHash) public {
        require(!isRegistered[msg.sender], "User already registered.");
        isRegistered[msg.sender] = true;
        users[msg.sender] = User(_faceHash, _ipfsHash);
        emit UserRegistered(msg.sender, _ipfsHash);
    }

    function getUserIPFSData() public view returns (string memory) {
        require(isRegistered[msg.sender], "User is not registered.");
        return users[msg.sender].ipfsHash;
    }
}
